/* This code is exporting the React library based on the environment it is running in. If the
environment is set to production, it will export the minified version of the library, and if it is
not in production, it will export the development version of the library. The `'use strict';`
statement at the beginning of the code enables strict mode in JavaScript, which enforces stricter
rules and better error handling. */
'use strict';

if (process.env.NODE_ENV === 'production') {
    module.exports = require('./cjs/react.production.min.js');
} else {
    module.exports = require('./cjs/react.development.js');
}
